import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import EmailPage from '../components/EmailForm/EmailForm';
import IELTSAcademic from './IELTSAcademic';


const Home = () =>{
    return (
        <Router>
            <Route exact path="/IELTSAcademic"><IELTSAcademic/></Route>
            <Route exact path="/Home"><EmailForm name="this is button" path="/IELTSAcademic"/></Route>
        </Router>
        
    )
}

export default Home;
